def set_sort_title(edition):
    articles = chain(
        *(LANGUAGE_ARTICLES.get(language, ()) for language in tuple(edition.languages))
    )
    edition.sort_title = re.sub(
        f"^{' |^'.join(articles)} ", "", str(edition.title).lower()
    )
    return edition


